import React from 'react';

function Cart({ cart }) {
  return (
    <div>
      <h1>Cart</h1>
      <ul>
        {cart.map((item, index) => (
          <li key={index}>
            {item.name} - Quantity: {item.quantity} - Price: {`\u20B9`}{item.price * item.quantity}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Cart;
